var hasTrailingZeros = function(nums) {
    // We will use a mask to check each bit position.
    // Since the maximum value is 100, 7 bits are enough (2^7 = 128).
    for (let i = 0; i < 7; i++) {
        let mask = 1 << i;
        let allHaveOne = true;

        // Check if all numbers have a '1' at the current bit position.
        for (let num of nums) {
            if ((num & mask) === 0) {
                allHaveOne = false;
                break;
            }
        }

        // If not all numbers have a '1' at this position,
        // it means there is at least one '0', so the OR will have a trailing zero.
        if (!allHaveOne) {
            return true;
        }
    }

    // If we didn't find any position with a trailing zero, return false.
    return false;
};
